  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Lower Hatchie NWR for the next 15 years. This
  plan outlines the Refuge vision and purpose and describes how Lower Hatchie NWR
  will contribute to the overall mission of the Refuge System. The plan provides an
  introduction to the Refuge, an overview of the CCP process, information about the
  management direction, and strategies for implementation. Key planning issues include:
  fish and wildlife populations, habitat management, visitor services, Refuge administration,
  and operations.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
